Congratulations to @roseboom_12 for a huge PR today!!!
.
Dave is a left handed pitcher with the New York Mets organization
.
16 weeks ago Dave and I started working together for strength training to improve his pitching speed
.
In that time he's improved his pitching velocity and improved his overall positioning in his pitches due to increased strength in the hips and external rotation
.
We have achieved significant sport-specific results
.
One focal point of our training was to convert his main hinge-focused strength component from Sumo Deadlifts to Conventional Deadlifts to better focus on growth in the glutes and hamstrings
.
His previous Sumo Deadlift PR was 525lb with an unknown (but less than) Conventional Deadlift PR due to not focusing on that variation of the lift
.
In 16 weeks we have eliminated all back pain in his Conventional Deadlift (a limitation he felt in the past) and grown the musculature of the lift to now support, as you see here, a kick-ass 600lb deadlift
.
In the extra photo and video you can see a technique exercise we used today following our max effort work
.
The deadlift variation is called "Plates Out Deadlifts" and allowed us to mimic the amount of bar bend similar to his one rep max but with lighter weights
.
Our focus was to work on loading  tension / positioning in the body before the bend occured in a position that as the bar bends to leave the floor he tightens into the right position
.
This will help his chest rise at the same rate as his hips keeping his lower back safe and keeping him in a better position to lift heavier weight
.
"Plates Out Deadlifts" are a great way to learn how to adjust to the bar bend of large lifts to work on both positioning and controlled explosiveness
.
Again, congratulations @roseboom_12 !!!
.
I'm super happy for you!!!!!
.
